						["custom_type"] = "event",
						["custom"] = "function(event, ...)\n    if not aura_env.parentFrame then\n        aura_env.parentFrame = WeakAuras.GetRegion(aura_env.parent)\n    end\n    \n    local frame = aura_env.parentFrame\n    \n    if frame then\n        local cfg = aura_env.config.alpha\n        local alpha = cfg.global\n        \n        if \"BARBER_SHOP_OPEN\" == event then\n            alpha = 0\n        else\n            local class = UnitClassBase(\"player\")\n            \n            if (IsMounted() and (not cfg.dragonriding_only or (HasBonusActionBar() and (11 == GetBonusBarIndex() or (\"EVOKER\" == class and 7 == GetBonusBarIndex()))))\n                or (not cfg.dragonriding_only and \"DRUID\" == class and (3 == GetShapeshiftForm() or 3 == GetShapeshiftFormID()))) then\n                \n                alpha = min(alpha, cfg.mounted)\n            else\n                if not UnitAffectingCombat(\"player\") then\n                    alpha = min(alpha, cfg.ooc)\n                end\n                \n                if UnitExists(\"target\") then\n                    local isEnemy = UnitCanAttack(\"player\", \"target\") or UnitIsEnemy(\"player\", \"target\")\n                    \n                    if (not isEnemy and cfg.ignore_friendly) or (isEnemy and cfg.ignore_enemy) then\n                        alpha = cfg.global\n                    end\n                end\n            end\n        end\n        \n        frame:SetAlpha(alpha / 100)\n        \n        return true\n    end\n    \n    return false\nend",
