						["custom"] = "function(event, arg1, arg2, arg3, arg4, ...)\n    if \"UNIT_SPELLCAST_SENT\" == event and \"player\" == arg1 then\n        aura_env.stealthed = false\n        \n        if (arg4 == 703 or arg4 == 1943) and WA_GetUnitBuff(\"player\", 1784) then\n            aura_env.stealthed = true\n        end\n        \n    elseif \"COMBAT_LOG_EVENT_UNFILTERED\" == event and arg4 == WeakAuras.myGUID then\n        local LWA = LWA and LWA[\"Rogue\"] or {}\n        local guid = select(4, ...)\n        local spellId = select(8, ...)\n        \n        if spellId == 200806 then -- Exsanguinate\n            \n            LWA.GarExsg = guid\n            LWA.RupExsg = guid\n            LWA.CTExsg = guid\n            \n        elseif spellId == 703 then -- Garrote\n            \n            if (aura_env.stealthed or -- Stealth\n                WA_GetUnitBuff(\"player\", 115191) or -- Subterfuge Stealth\n                WA_GetUnitBuff(\"player\", 115192) or -- Subterfuge\n                WA_GetUnitBuff(\"player\", 185422) or -- Shadow Dance\n                WA_GetUnitBuff(\"player\", 392401) or -- Improved Garrote\n                WA_GetUnitBuff(\"player\", 11327)) then -- Vanish\n                \n                LWA.GarSnap[guid] = true\n            else\n                LWA.GarSnap[guid] = nil\n            end\n            \n            LWA.GarExsg = nil\n            \n        elseif spellId == 1943 then -- Rupture\n            --[[\n            if (aura_env.stealthed or -- Stealth\n                WA_GetUnitBuff(\"player\", 11327)) then -- Vanish\n                LWA.RupSnap[guid] = true\n            else\n                LWA.RupSnap[guid] = nil\n            end]]\n            \n            LWA.RupExsg = nil\n        end\n    end\n    \n    return false\nend",
